import React from 'react';
import Toolbar from "./toolbar"

const layout=(props)=>{
  return(
    <div style={styles.containerStyle}>
      <Toolbar /> 
      {props.children}
    </div>
  )
}

const styles ={
  containerStyle: {
    display: "flex",
    alignItems: "center",
    flexDirection: "column",
    height: "100vh",
    justifyContent: "center",
    backgroundColor: "#fffffa"
    },
}
export default layout
